import React from "react";
import classes from "./Heatmap.module.css";

const Heatmap = () => {
  return (
    <div className="container">
    <div className={classes.mainse}>
      <div
        id="highcharts-e3087h1-0"
        dir="ltr"
        className="highcharts-container "
        style={{
          position: "relative",
          overflow: "hidden",
          width: 1034,
          height: 400,
          textAlign: "left",
          lineHeight: "normal",
          zIndex: 0,
          WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
          userSelect: "none",
        }}
        tabIndex={0}
        aria-hidden="false"
      >
        <svg
          version="1.1"
          className="highcharts-root"
          style={{
            fontFamily:
              '"Lucida Grande", "Lucida Sans Unicode", Arial, Helvetica, sans-serif',
            fontSize: 12,
          }}
          xmlns="http://www.w3.org/2000/svg"
          width={1034}
          height={400}
          viewBox="0 0 1034 400"
          aria-label="Interactive chart"
          aria-hidden="false"
        >
          <desc aria-hidden="true">Created with Highcharts 8.2.2</desc>
          <defs aria-hidden="true">
            <clipPath id="highcharts-e3087h1-1-">
              <rect x={0} y={0} width={1014} height={375} fill="none" />
