          <rect
            fill="#ffffff"
            className="highcharts-background"
            x={0}
            y={0}
            width={1034}
            height={400}
            rx={0}
            ry={0}
            aria-hidden="true"
          />
          <rect
            fill="none"
            className="highcharts-plot-background"
            x={10}
            y={10}
            width={1014}
            height={375}
            aria-hidden="true"
          />
          <g
            className="highcharts-grid highcharts-xaxis-grid"
            data-z-index={1}
            aria-hidden="true"
          />
          <g
            className="highcharts-grid highcharts-yaxis-grid"
            data-z-index={1}
            aria-hidden="true"
          />
          <rect
