            <path
              fill="none"
              className="highcharts-axis-line"
              data-z-index={7}
              d="M 10 10 L 10 385"
            />
          </g>
          <path
            fill="none"
            className="highcharts-crosshair highcharts-crosshair-thin undefined"
            data-z-index={2}
            stroke="#999999"
            strokeWidth="0.01"
            style={{ pointerEvents: "none" }}
            visibility="hidden"
            d="M 0 0"
            aria-hidden="true"
